"use strict";(globalThis.webpackChunkhoclamdev=globalThis.webpackChunkhoclamdev||[]).push([[130],{7735(n){n.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"things-to-do-after-installing-ubuntu","metadata":{"permalink":"/blog/things-to-do-after-installing-ubuntu","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2026-01-02-things-to-do-after-installing-ubuntu/index.md","source":"@site/blog/2026-01-02-things-to-do-after-installing-ubuntu/index.md","title":"Things to Do After Installing Ubuntu","description":"Things to Do After Installing Ubuntu","date":"2026-01-02T00:00:00.000Z","tags":[{"inline":false,"label":"Ubuntu","permalink":"/blog/tags/ubuntu","description":"Ubuntu tips and tricks"},{"inline":false,"label":"Tips","permalink":"/blog/tags/tips","description":"Tips for developer"}],"readingTime":1.23,"hasTruncateMarker":false,"authors":[{"name":"Hieu Nguyen","title":"Senior Software Engineer","url":"https://linkedin.com/in/nokanguyen","page":{"permalink":"/blog/authors/noka"},"socials":{"linkedin":"https://www.linkedin.com/in/nokanguyen/","github":"https://github.com/nokavietnam","newsletter":"https://hoclamdev.com"},"imageURL":"https://raw.githubusercontent.com/nokavietnam/nokaresources/3583806b6cc81ed98509570576cf78665570f5bb/avatar-noka.jpg","key":"noka"}],"frontMatter":{"slug":"things-to-do-after-installing-ubuntu","title":"Things to Do After Installing Ubuntu","authors":["noka"],"tags":["ubuntu","tips"]},"unlisted":false,"nextItem":{"title":"Intro Vim editor - Lazy Vim","permalink":"/blog/vim-editor"}},"content":"## Things to Do After Installing Ubuntu\\r\\n\\r\\nIn this post, I want to share the things I usually do after installing Ubuntu.\\r\\n\\r\\n\\r\\n### Update and upgrade package\\r\\n\\r\\nUpdate and upgrade your system to keep your software up to date.\\r\\n\\r\\n```bash\\r\\nsudo apt update\\r\\n\\r\\nsudo apt upgrade -y\\r\\n```\\r\\n\\r\\n### Remove unused packages\\r\\n\\r\\nThis command helps clean up unused packages and free disk space.\\r\\n\\r\\n```bash\\r\\nsudo apt autoremove\\r\\n```\\r\\n\\r\\n### Install compilation tools\\r\\n\\r\\nInstall the basic compilation tools required to build software from source.\\r\\n\\r\\n```bash\\r\\n# Install essential build tools (gcc, make, etc.)\\r\\nsudo apt install build-essential\\r\\n\\r\\n# check\\r\\ngcc --version\\r\\ng++ --version\\r\\n```\\r\\n\\r\\n### Install network tool\\r\\n\\r\\nProvides legacy networking commands such as `ifconfig` and `netstat`\\r\\n\\r\\n```bash\\r\\n# Install network utilities like ifconfig, netstats\\r\\nsudo apt install net-tools\\r\\n\\r\\n# check ip\\r\\nifconfig\\r\\n```\\r\\n\\r\\n### Install firewall\\r\\n\\r\\nInstall a user-friendly firewall tool to helps secure your Ubuntu system and control incoming and outgoing network traffic.\\r\\n\\r\\n```bash\\r\\n# Install UFW firewall\\r\\nsudo apt install ufw\\r\\n\\r\\n# Check status firewall\\r\\nsudo ufw status verbose\\r\\n\\r\\n# If you use SSH remotely, allow SSH before enabling the firewall\\r\\nsudo ufw allow ssh # (skip this step if you are using Ubuntu as a desktop client)\\r\\n\\r\\n# enalbe firewall\\r\\nsudo ufw enable\\r\\n\\r\\n# Control ufw via GUI\\r\\nsudo apt install gufw\\r\\n\\r\\n```\\r\\n\\r\\n### Other Useful Tools\\r\\n\\r\\n```bash\\r\\n## Optional but Recommended\\r\\n\\r\\n# Install Git\\r\\nsudo apt install git\\r\\n\\r\\n# Config git \\r\\ngit config --global user.name \\"Your Name\\"\\r\\nit config --global user.email \\"your.email@example.com\\"\\r\\n\\r\\n# Install curl, wget\\r\\nsudo apt install curl\\r\\nsudo apt install wget\\r\\n\\r\\n```\\r\\n\\r\\nThanks for reading, I hope you find this helpful."},{"id":"vim-editor","metadata":{"permalink":"/blog/vim-editor","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2025-10-26-vim-editor/index.md","source":"@site/blog/2025-10-26-vim-editor/index.md","title":"Intro Vim editor - Lazy Vim","description":"What is Vim?","date":"2025-10-26T00:00:00.000Z","tags":[{"inline":false,"label":"Tool","permalink":"/blog/tags/tool","description":"Tool for developer"}],"readingTime":4.3,"hasTruncateMarker":false,"authors":[{"name":"Hieu Nguyen","title":"Senior Software Engineer","url":"https://linkedin.com/in/nokanguyen","page":{"permalink":"/blog/authors/noka"},"socials":{"linkedin":"https://www.linkedin.com/in/nokanguyen/","github":"https://github.com/nokavietnam","newsletter":"https://hoclamdev.com"},"imageURL":"https://raw.githubusercontent.com/nokavietnam/nokaresources/3583806b6cc81ed98509570576cf78665570f5bb/avatar-noka.jpg","key":"noka"}],"frontMatter":{"slug":"vim-editor","title":"Intro Vim editor - Lazy Vim","authors":["noka"],"tags":["tool"]},"unlisted":false,"prevItem":{"title":"Things to Do After Installing Ubuntu","permalink":"/blog/things-to-do-after-installing-ubuntu"},"nextItem":{"title":"100 Days Leetcode","permalink":"/blog/tags/100-days-leetcode"}},"content":"## What is `Vim`?\\r\\n\\r\\n[Vim](https://www.vim.org/) is a highly configurable text editor built to make creating and changing any kind of text very efficient. It is included as \\"vi\\" with most UNIX systems and with Apple OS X.\\r\\n\\r\\n## What is the `LazyVim`?\\r\\n\\r\\nLazyVim is a Neovim setup powered by \ud83d\udca4 [lazy.nvim](https://www.lazyvim.org/) to make it easy to customize and extend your config.\\r\\n\\r\\n## What is `Tmux`?\\r\\n\\r\\n[Tmux](https://github.com/tmux/tmux/wiki/Getting-Started) is a terminal multiplexer. It lets you switch easily between several programs in one terminal, detach them (they keep running in the background) and reattach them to a different terminal.\\r\\n\\r\\n### Installation\\r\\n\\r\\n#### Install `Nvim`\\r\\n\\r\\n[Nvim](https://neovim.io/) is based on Vim by Bram Moolenaar. Nvim is emphatically a fork of Vim, not a clone: compatibility with Vim (especially editor and Vimscript features, except Vim9script) is maintained where possible. See vim-differences for the complete reference.\\r\\n\\r\\n[Install Nvim](https://neovim.io/doc2/install/)\\r\\n\\r\\nOn Linux \\r\\n\\r\\n```\\r\\ncurl -LO https://github.com/neovim/neovim/releases/latest/download/nvim-linux-x86_64.tar.gz\\r\\n\\r\\nsudo rm -rf /opt/nvim-linux-x86_64\\r\\n\\r\\nsudo tar -C /opt -xzf nvim-linux-x86_64.tar.gz\\r\\n\\r\\n```\\r\\n\\r\\nAdd to file  `~/.bashrc`\\r\\n\\r\\n```\\r\\n\\r\\nexport PATH=\\"$PATH:/opt/nvim-linux-x86_64/bin\\"\\r\\n```\\r\\n\\r\\nCheck again\\r\\n\\r\\n```\\r\\nnvim --version\\r\\n\\r\\n\\r\\n# Output \\r\\n\\r\\nNVIM v0.11.4\\r\\nBuild type: Release\\r\\nLuaJIT 2.1.1741730670\\r\\nRun \\"nvim -V1 -v\\" for more info\\r\\n```\\r\\n\\r\\n#### Install `LazyVim`\\r\\n\\r\\n[Install LazyVim](https://www.lazyvim.org/installation)\\r\\n\\r\\nBackup old Neovim \\r\\n\\r\\n```\\r\\n# required\\r\\nmv ~/.config/nvim{,.bak}\\r\\n\\r\\n# optional but recommended\\r\\nmv ~/.local/share/nvim{,.bak}\\r\\nmv ~/.local/state/nvim{,.bak}\\r\\nmv ~/.cache/nvim{,.bak}\\r\\n```\\r\\n\\r\\nInstall Lazzy Vim \\r\\n\\r\\n```\\r\\ngit clone https://github.com/LazyVim/starter ~/.config/nvim\\r\\n\\r\\nrm -rf ~/.config/nvim/.git\\r\\n```\\r\\n\\r\\nStart Neovim, and waitin to LazyVim finish setup.\\r\\n\\r\\n```\\r\\nnvim\\r\\n```\\r\\n\\r\\n#### Install `Tmux`\\r\\n\\r\\n[Install Tmux](https://github.com/tmux/tmux/wiki/Installing)\\r\\n\\r\\n\\r\\nOn debian\\r\\n\\r\\n```\\r\\nsudo apt install tmux\\r\\n```\\r\\n\\r\\nInstall Tmux Plugin Manager. Custome your tmux (if you need or skip -> jump to next step, it not required)\\r\\n\\r\\n[Install Tmux Plugin Manager](https://github.com/tmux-plugins/tpm)\\r\\n\\r\\nMy config tmux. You can copy and put to file ~/.tmux.conf or reference at [tmux-plugin](https://github.com/tmux-plugins/list)\\r\\n\\r\\n```\\r\\n# .tmux.conf\\r\\n\\r\\nset -g default-terminal \'screen-256color\'\\r\\nset -g status-style \'bg=#1e1e2e\'\\r\\n\\r\\nsetw -g mode-keys vi\\r\\nbind-key h select-pane -L\\r\\nbind-key j select-pane -D\\r\\nbind-key k select-pane -U\\r\\nbind-key l select-pane -R\\r\\n\\r\\nbind -r J resize-pane -D 5\\r\\nbind -r K resize-pane -U 5\\r\\nbind -r H resize-pane -L 5\\r\\nbind -r L resize-pane -R 5\\r\\n\\r\\n# List of plugins\\r\\nset -g @plugin \'tmux-plugins/tpm\'\\r\\nset -g @plugin \'tmux-plugins/tmux-sensible\'\\r\\n\\r\\n# Other examples:\\r\\n# set -g @plugin \'github_username/plugin_name\'\\r\\n# set -g @plugin \'github_username/plugin_name#branch\'\\r\\n# set -g @plugin \'git@github.com:user/plugin\'\\r\\n# set -g @plugin \'git@bitbucket.com:user/plugin\'\\r\\n\\r\\n# theme\\r\\nset -g @plugin \'dracula/tmux\'\\r\\n# set -g @dracula-plugins \'cpu-usage ram-usage\'\\r\\n# set -g @dracula-cpu-usage-colors \'pink dark-gray\'\\r\\nset -g @dracula-show-powerline true\\r\\nset -g @dracula-show-flags true\\r\\nset -g @dracula-show-left-icon session\\r\\nset -g @dracula-cpu-display-load true\\r\\nset -g @dracula-plugins \\"cpu-usage ram-usage\\"\\r\\n# per default available colors: white, gray, dark_gray, light_purple, dark_purple, cyan, green, orange, red, pink, yellow\\r\\n# set -g @dracula-[plugin-name]-colors \\"[background] [foreground]\\"\\r\\nset -g @dracula-cpu-usage-colors \\"pink dark_gray\\"\\r\\n# the default is 5, it can accept any number\\r\\nset -g @dracula-refresh-rate 5\\r\\nset -g @dracula-border-contrast true\\r\\nset -g @dracula-transparent-powerline-bg true\\r\\n# default is 1, it can accept any number and 0 disables padding.\\r\\nset -g @dracula-left-icon-padding 0\\r\\nset -g @dracula-show-battery-status true\\r\\nset -g @dracula-time-format \\"%F %R\\"\\r\\nset -g status-position top\\r\\n\\r\\n\\r\\n# neovim\\r\\nset -g @plugin \'christoomey/vim-tmux-navigator\'\\r\\n\\r\\nset -g @vim_navigator_mapping_left \\"C-Left C-h\\"  # use C-h and C-Left\\r\\nset -g @vim_navigator_mapping_right \\"C-Right C-l\\"\\r\\nset -g @vim_navigator_mapping_up \\"C-k\\"\\r\\nset -g @vim_navigator_mapping_down \\"C-j\\"\\r\\nset -g @vim_navigator_mapping_prev \\"\\"  # removes the C-\\\\ binding\\r\\n\\r\\nset -g @vim_navigator_prefix_mapping_clear_screen \\"\\"\\r\\n\\r\\n\\r\\nset -g @plugin \'laktak/extrakto\'\\r\\nset -g @plugin \'rickstaa/tmux-notify\'\\r\\nset -g @plugin \'sainnhe/tmux-fzf\'\\r\\nset -g @plugin \'AngryMorrocoy/tmux-neolazygit\'\\r\\n\\r\\n## config auto reopen session\\r\\n#set -g @plugin \'tmux-plugins/tmux-resurrect\'\\r\\n#set -g @plugin \'tmux-plugins/tmux-continuum\'\\r\\n\\r\\n#set -g @continuum-restore \'on\'\\r\\n#set -g @continuum-boot \'on\'\\r\\n\\r\\n\\r\\n# Initialize TMUX plugin manager (keep this line at the very bottom of tmux.conf)\\r\\nrun \'~/.tmux/plugins/tpm/tpm\'\\r\\n```\\r\\n\\r\\nOn Terminal\\r\\n\\r\\nStart tmux\\r\\n\\r\\n```\\r\\ntmux \\r\\n```\\r\\n\\r\\n`Ctrl b` -> `Shift + i` => To install plugin\\r\\n`Ctrl b` -> `Shift + u` -> all -> To update all plugin\\r\\n\\r\\n`Ctrl b`: is default prefix. You can change with config \\r\\n\\r\\n```\\r\\n# ~/.tmux.conf\\r\\n# remap prefix from \'C-b\' to \'C-a\'\\r\\nunbind C-b\\r\\nset-option -g prefix C-a\\r\\nbind-key C-a send-prefix\\r\\n```\\r\\n\\r\\n### Basic\\r\\n\\r\\n#### Keymaps\\r\\n\\r\\n[Keymaps](https://www.lazyvim.org/keymaps)\\r\\n\\r\\n\\r\\n### Plugin\\r\\n\\r\\n[Plugin](https://www.lazyvim.org/plugins)\\r\\n\\r\\n### Config Nvim for tmux\\r\\n\\r\\n```\\r\\n# ~/.config/nvim/lua/plugins\\r\\n\\r\\nreturn {\\r\\n  {\\r\\n    \\"christoomey/vim-tmux-navigator\\",\\r\\n    cmd = {\\r\\n      \\"TmuxNavigateLeft\\",\\r\\n      \\"TmuxNavigateDown\\",\\r\\n      \\"TmuxNavigateUp\\",\\r\\n      \\"TmuxNavigateRight\\",\\r\\n      \\"TmuxNavigatePrevious\\",\\r\\n      \\"TmuxNavigatorProcessList\\",\\r\\n    },\\r\\n    keys = {\\r\\n      { \\"<c-h>\\",  \\"<cmd><C-U>TmuxNavigateLeft<cr>\\" },\\r\\n      { \\"<c-j>\\",  \\"<cmd><C-U>TmuxNavigateDown<cr>\\" },\\r\\n      { \\"<c-k>\\",  \\"<cmd><C-U>TmuxNavigateUp<cr>\\" },\\r\\n      { \\"<c-l>\\",  \\"<cmd><C-U>TmuxNavigateRight<cr>\\" },\\r\\n      { \\"<c-\\\\\\\\>\\", \\"<cmd><C-U>TmuxNavigatePrevious<cr>\\" },\\r\\n    },\\r\\n  },\\r\\n}\\r\\n\\r\\n```\\r\\n\\r\\nInstall plugin for nvim\\r\\n\\r\\n```\\r\\nnvim\\r\\n\\r\\n# Press l -> Shift u -> Shift s\\r\\n\\r\\n\\r\\n```\\r\\n\\r\\n\\r\\n## Why I choose `LazyVim` and `Tmux`?\\r\\n\\r\\n\\r\\n## Thank for reading!"},{"id":"/tags/100-days-leetcode","metadata":{"permalink":"/blog/tags/100-days-leetcode","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/tags/100-days-leetcode.md","source":"@site/blog/tags/100-days-leetcode.md","title":"100 Days Leetcode","description":"100 Days LeetCode","date":"2025-09-28T16:23:52.000Z","tags":[{"inline":false,"label":"100 Days LeetCode","permalink":"/blog/tags/100-days-leetcode","description":"100 Days LeetCode Challenge"}],"readingTime":0.02,"hasTruncateMarker":false,"authors":[{"name":"Hieu Nguyen","title":"Senior Software Engineer","url":"https://linkedin.com/in/nokanguyen","page":{"permalink":"/blog/authors/noka"},"socials":{"linkedin":"https://www.linkedin.com/in/nokanguyen/","github":"https://github.com/nokavietnam","newsletter":"https://hoclamdev.com"},"imageURL":"https://raw.githubusercontent.com/nokavietnam/nokaresources/3583806b6cc81ed98509570576cf78665570f5bb/avatar-noka.jpg","key":"noka"}],"frontMatter":{"slug":"/tags/100-days-leetcode","title":"100 Days Leetcode","authors":["noka"],"tags":["100-days-leetcode"]},"unlisted":false,"prevItem":{"title":"Intro Vim editor - Lazy Vim","permalink":"/blog/vim-editor"},"nextItem":{"title":"100 Days Leetcode - Day 1","permalink":"/blog/100-days-leetcode-day-1"}},"content":"## 100 Days LeetCode"},{"id":"100-days-leetcode-day-1","metadata":{"permalink":"/blog/100-days-leetcode-day-1","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2025-09-28-100-days-leetcode-day-1/index.md","source":"@site/blog/2025-09-28-100-days-leetcode-day-1/index.md","title":"100 Days Leetcode - Day 1","description":"Day 1 - Contains Duplicate","date":"2025-09-28T00:00:00.000Z","tags":[{"inline":false,"label":"leetcode","permalink":"/blog/tags/leetcode","description":"LeetCode"},{"inline":false,"label":"Data Structures and algorithms","permalink":"/blog/tags/dsa","description":"Data struture and algorithm"},{"inline":false,"label":"100 Days LeetCode","permalink":"/blog/tags/100-days-leetcode","description":"100 Days LeetCode Challenge"}],"readingTime":1.31,"hasTruncateMarker":false,"authors":[{"name":"Hieu Nguyen","title":"Senior Software Engineer","url":"https://linkedin.com/in/nokanguyen","page":{"permalink":"/blog/authors/noka"},"socials":{"linkedin":"https://www.linkedin.com/in/nokanguyen/","github":"https://github.com/nokavietnam","newsletter":"https://hoclamdev.com"},"imageURL":"https://raw.githubusercontent.com/nokavietnam/nokaresources/3583806b6cc81ed98509570576cf78665570f5bb/avatar-noka.jpg","key":"noka"}],"frontMatter":{"slug":"100-days-leetcode-day-1","title":"100 Days Leetcode - Day 1","authors":["noka"],"tags":["leetcode","dsa","100-days-leetcode"]},"unlisted":false,"prevItem":{"title":"100 Days Leetcode","permalink":"/blog/tags/100-days-leetcode"}},"content":"## Day 1 - Contains Duplicate\\r\\n\\r\\n### Description\\r\\n\\r\\nGiven an integer array `nums`, return true if any value appears at least twice in the array, and return false if every element is distinct.\\r\\n\\r\\n```markdown\\r\\n\\r\\nExample 1:\\r\\nInput: nums = [1, 2, 3, 1]\\r\\nOutput: false\\r\\n\\r\\nExample 2:\\r\\nInput: nums = [1, 2, 3, 4]\\r\\nOutput: false\\r\\n\\r\\nExample 3:\\r\\nInput: nums = [1, 1, 1, 3, 3, 4, 3, 2 , 4, 2]\\r\\nOutput: true\\r\\n\\r\\nConstraints:\\r\\n1 <= nums.length <= 10^5\\r\\n-10^9 <= nums[i] <= 10^9\\r\\n\\r\\n```\\r\\n\\r\\n### Solution \\r\\n\\r\\n#### Approach 1 - Sorting\\r\\n\\r\\nStep 1: We will sort the array nums. If two numbers are the same, they will be placed next to each other. Step 2: We just need to check whether the two adjacent numbers are equal or not.\\r\\n\\r\\n```go\\r\\nclass Solution {\\r\\n  public boolean containsDuplicate(int[] nums) {\\r\\n    Arrays.sort(nums);\\r\\n\\r\\n    for (int i = 0; i < nums.length; ++i) {\\r\\n      if (nums[i] == nums[i - 1]) {\\r\\n        return true;\\r\\n      }\\r\\n    }\\r\\n\\r\\n    return false;\\r\\n  }\\r\\n}\\r\\n```\\r\\n\\r\\nComplexity:\\r\\n\\r\\n```markdown\\r\\nTime\\r\\nsort => Dual-Pivot Quicksort O(n log n)\\r\\nfor => O(n)\\r\\n\\r\\nResult: O(n log n + n) = O(n log n)\\r\\n\\r\\nSpace\\r\\nO(1)\\r\\n```\\r\\n\\r\\n#### Approach 2 - HashSet\\r\\n\\r\\nWe create a `Set` and add each element of the `nums` array into the set. If the insertion fails, it means the element is duplicated, and we return true. Otherwise, if we finish checking the entire array without any failure, it means the array has no duplicated.\\r\\n\\r\\n```go\\r\\nclass Solution {\\r\\n  public boolean containsDuplicate(int[] nums) {\\r\\n    Set<Integer> setNums = new HashSet<>();\\r\\n    for (int num : nums) {\\r\\n      if (!setNums.add(nums)) {\\r\\n        return true;\\r\\n      }\\r\\n    }\\r\\n    return false;\\r\\n  }\\r\\n}\\r\\n\\r\\n```\\r\\n\\r\\n```markdown\\r\\n\\r\\nComplexity\\r\\n\\r\\nTime\\r\\nfor => O(n)\\r\\n\\r\\nSpace\\r\\nSet => O(n)\\r\\n```\\r\\n\\r\\nThank for reading!"}]}}')}}]);